window.bookSummaryJSON = "<p>Rowan Callahan is a career-climbing attorney focused on her future. But vicious - and false - rumors are destroying her professional life. That all ceases to matter when a plane crashes in downtown Chicago and the entire city goes dark, and she realizes she’s just witnessed the kick-off to the apocalypse. Armed with a backpack of supplies, she leaves Chicago, intent on resetting her skewed priorities and seeking shelter at the family farm with her father and sister. </p> <p>She’s injured and running for her life when she stumbles directly in the crosshairs of two men who just might be her salvation...and her greatest temptation.</p>"; 
